import './style.css'; 
import Card from '../UI/Card';

/**
* @author
* @function BlogPost
**/

const BlogPost = (props) => {
  return(
    <div className='blogPostConteiner'>
      <Card>
        <div>
          <span>Featured</span>
          <h1>Post about FoldScope here</h1>
          <span>posted onFebruary 06.2020 by"some author" Blogging Tips</span>
       </div>
      </Card>
    </div>
   )

 }

export default BlogPost
